 }


/* Nav links container */
.nav-links {
    display: flex;
    justify-content: center;
    list-style: none;
    flex-wrap: wrap;
    transition: opacity 0.3s ease-in-out;
    /* Smooth transition for showing links */
    opacity: 1;
    gap: 10px;
}

.nav-links a {
    color: white;
    text-decoration: none;
    font-weight: bold;

}

.bar {
    background-color: white;
    height: 3px;
    width: 25px;
    margin: 4px 0;
}

.nav-links.active {
    display: flex;
    opacity: 1;
}

.nav-links a:hover {
    color: red;
    transform: scale(1.1);
    transition: 0.5s;
}

/* Responsive styles for smaller screens */
@media (max-width: 500px) {
    .nav-links {
        display: none;
        flex-direction: column;
        width: auto;
        background-color: black;
        position: absolute;
        right: 50px;
    }

    .nav-links a {
        color: white;
        text-decoration: none;
        font-weight: bold;

    }

    .nav-links.active {
        display: flex;
    }

    .menu-toggle {
        display: flex;
        flex-direction: column;
        cursor: pointer;
    }

    .bttn {
        display: none;
    }

    .nav-links li {
        margin: 10px 0;
        text-align: center;
    }
}

