/* Icons Section */

/* Form Styling */
.contact-form label {
    display: block;
    font-size: 14px;
    color: #000;
    margin-bottom: 5px;
}

.contact-form input {
    width: 100%;
    padding: 10px;
    margin-bottom: 15px;
    border: 1px solid #ccc;
    border-radius: 4px;
    font-size: 14px;
}

.contact-form button {
    width: 100%;
    padding: 10px;
    background-color: black;
    color: white;
    font-size: 16px;
    border: none;
    border-radius: 4px;
    cursor: pointer;
    transition: background-color 0.3s ease;
}

.contact-form button:hover {
    background-color: #333;
}

/* Services Section */
.services-section {
  text-align: center;
  padding: 50px 20px;
}

.services-section h1 {
  font-size: 2.5rem;
  margin-bottom: 40px;
}

.services-container {
  display: flex;
  gap: 20px;
  justify-content: center;
  flex-wrap: wrap;
}

.service-card {
  background: rgba(255, 255, 255, 0.1);
  border-radius: 10px;
  padding: 20px;
  width: 300px;
  text-align: center;
  transition: transform 0.3s, box-shadow 0.3s;
  box-shadow: 0 5px 15px rgba(255, 255, 255, 0.3);
}

.service-card:hover {
  transform: translateY(-10px);
  box-shadow: 0 10px 25px rgba(255, 255, 255, 0.5);
}

.service-img img {
  width: 80px;
  height: 80px;
  border-radius: 50%;
  transition: transform 0.2s ease;
}

.service-img:hover img {
  transform: scale(1.1);
  box-shadow: 0 10px 25px rgba(255, 255, 255, 0.4);
}

.service-card h2 {
  font-size: 1.5rem;
  margin: 15px 0;
}

.service-card p {
  font-size: 1rem;
  line-height: 1.5;
}

/* Testimonials Section */
.testimonials-section {
  text-align: center;
  padding: 50px 20px;
  /* background: url('https://via.placeholder.com/1600x900') no-repeat center/cover; */
  background-color: #fffff;
}
.testimonial-section h1 {
    font-size: 2.5rem;
    margin-bottom: 30px;
  }

.testimonials-container {
  display: flex;
  gap: 20px;
  justify-content: center;
  flex-wrap: wrap;
}

.testimonial-card {
  background: rgba(255, 255, 255, 0.1);
  padding: 20px;
  border-radius: 10px;
  box-shadow: 0 5px 15px rgba(0, 0, 0, 0.3);
  width: 300px;
  transition: transform 0.3s ease, box-shadow 0.3s ease;
}

.testimonial-card:hover {
  transform: translateY(-10px);
  box-shadow: 0 10px 25px rgba(255, 255, 255, 0.4);
}

.quote-icon {
  font-size: 2rem;
}

.testimonial-content p {
  margin: 15px 0;
  font-size: 1rem;
  color: #e0e0e0;
}

.testimonial-content h3 {
  margin-top: 10px;
  font-size: 1.2rem;
}

/* Responsive Design */
@media (max-width: 768px) {
  .services-container,
  .testimonials-container {
    flex-direction: column;
    align-items: center;
  }

  .service-card,
  .testimonial-card {
    width: 90%;
  }
}

/* Contact Section Styling */
.contact-section {
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: 50px 20px;
    position: relative;
}

.contact-content {
    text-align: center;
    margin-bottom: 40px;
}

.contact-content h1 {
    font-size: 2rem;
    margin-bottom: 20px;
}

.contact-btn {
    background-color: #fff;
    color: #000;
    padding: 10px 20px;
    border: none;
    border-radius: 20px;
    font-size: 1rem;
    cursor: pointer;
    transition: transform 0.3s;
}

.contact-btn:hover {
    transform: scale(1.05);
}

.contact-details {
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;
    width: 100%;
    max-width: 1200px;
    margin-top: 20px;
    gap: 20px;
    text-align: center;
}

.contact-info,
.contact-hours,
.contact-location {
    flex: 1;
    min-width: 250px;
}

.contact-info h3,
.contact-hours h3 {
    font-size: 1.2rem;
    margin-bottom: 10px;
}

.contact-info p,
.contact-hours p,
.contact-location p {
    font-size: 1rem;
    margin: 5px 0;
}

/* Floating Buttons Styling */
.floating-buttons {
    position: fixed;
    bottom: 20px;
    right: 20px;
    display: flex;
    flex-direction: column;
    gap: 10px;
}

.floating-buttons a img {
    width: 50px;
    height: 50px;
    border-radius: 50%;
    box-shadow: 0 5px 15px rgba(0, 0, 0, 0.5);
    transition: transform 0.3s ease, box-shadow 0.3s ease;
}

.floating-buttons a img:hover {
    transform: scale(1.1);
    box-shadow: 0 10px 20px rgba(255, 255, 255, 0.5);
}

/* Responsive Design */
@media (max-width: 768px) {
    .contact-details {
        flex-direction: column;
        text-align: center;
    }

    .contact-info,
    .contact-hours,
    .contact-location {
        text-align: center;
    }
}

footer {
