.hover-effect {
    position: relative;
    font-size: 16px;
    font-weight: bold;
}

.footer-lefts:hover a{
    left: 0;
    background-color: black;
    color: white;
    padding: 5px 10px;
    border: 1px solid white;
    font-size: 14px;
} 

/* "Let's Chat" Button */
#chat-btn {
    position: fixed;
    bottom: 20px;
    right: 20px;
    background-color: black;
    color: white;
    border: 2px solid white;
    border-radius: 5px;
    padding: 10px 15px;
    font-size: 14px;
    cursor: pointer;
    transition: all 0.3s ease;
    z-index: 1000;
}

#chat-btn:hover {
    background-color: white;
    color: black;
}

/* Chat Box Styles */
#chat-box {
    position: fixed;
    bottom: 70px;
    right: 20px;
    width: 300px;
    background-color: black;
    border: 2px solid white;
    border-radius: 10px;
    display: none;
    flex-direction: column;
    z-index: 1000;
}

.chat-header {
    background-color: white;
    color: black;
    padding: 10px;
    font-size: 16px;
    font-weight: bold;
    display: flex;
    justify-content: space-between;
    align-items: center;
}

.chat-body {
    padding: 15px;
    color: white;
    font-size: 14px;
    text-align: center;
}

.chat-icons a {
    margin: 10px;
    font-size: 24px;
    text-decoration: none;
    color: white;
    transition: color 0.3s ease;
}

.chat-icons a:hover {
    color: green;
}

textarea {
    width: 100%;
    border: none;
    padding: 10px;
    resize: none;
    font-size: 14px;
    color: black;
}

textarea:focus {
    outline: none;
}

/* Responsive Design */
@media (max-width: 768px) {
    .footer-container {
        flex-direction: column;
        text-align: center;
    }

    #chat-box {
        width: 90%;
        right: 5%;
    }

    .footer-left,
    .footer-center,
    .footer-right {
        margin: 10px 0;
    }
